import React from 'react';
import client from '../util/shopify-client'



const MyProduct = () => {

    client.product.fetchAll().then((products) => {
        products.map((item,i) => (
            <div style={{
                position:"relative",
                top:"20vh",
                color:"white"
            }}>
                Hello
                {console.log(item.description)}
            </div>
        ))
    })

}


const Store = () => {
    return(
        <div>
            Hello
            <MyProduct />
        </div>
    )
}

export default Store;
